import { GridItem } from './ItemGrid';

export interface GridViewProps{
  items: any[]
}

const GridView = (props: GridViewProps) => {
  return <div style={{flex: 1, justifyContent: 'center', display: 'flex', width: 120}}>
    {props.items.map((item, index) => <div key={index} style={{width: 60, height: 60, border: '1px solid lightblue', textAlign: 'center'}}>
      {item && item.id && (index >=2) && <GridItem id={item.id} image={item.image} />}
      {item && item.id && (index >=5) && <GridItem id={item.id} image={item.image} />}
      {item && item.id && (index >=7) && <GridItem id={item.id} image={item.image} />}
    </div>)}
  </div>
}

export default GridView
